import React from "react";

export const SectionImg = () => {
    return (
        <div class="">
            <div>
                <img src="https://cms-images.mmst.eu/2rj3gcd43pmw/X1s76hIAACQAcE2X/7b1ca0f17647631b0b498811510433c5/Prismic_LP_Visual_Energielabels_1257x703_Teaser_1.jpg?q=80" alt="Nuevas etiquetas de eficiencia energetica"/>
            </div>
            <div>
                <h2>
                    Etiquetas
                </h2>
                <p>
                    Probablemente estés familiarizado con las coloridas etiquetas energéticas que muestra tu última compra de electrodomésticos en Media Markt. Durante más de veinte años, estas etiquetas muestran claramente los datos más importantes de tu electrodoméstico, y con ellas, el desarrollo de la tecnología y de aparatos cada vez más eficientes. 
                    Dado que los dispositivos se han vuelto cada vez más eficientes energéticamente y cumplen con un estándar mucho más alto que el que cubría la Clase A, el concepto actual se ha vuelto menos transparente para todas las partes interesadas. Las diferencias entre A + y A +++ son a veces muy pequeñas, con lo que la UE ha decidido volver a la escala anterior con una nueva etiqueta.
                    Las que conocemos ahora como A +++, A ++, A +, A, B, C y D, pasarán a ser a partir de marzo de 2021 nuevamente de A a G. Donde A significa dispositivos muy eficientes, que todavía están por salir; los dispositivos B y C identifican los dispositivos más eficientes. 
                </p>
            </div>
        </div>
  );
};
